import styles from './App.module.css';
import {User} from './User'
//app is known as component
function App() {
  const users= [
    {name:"tlotlsio",age: 21},
    {name:"kagiso",age: 50},
  ];

  return (
    <div className={styles.App}>
      {users.map((user, key) => {
          return <User name={user.name} age={user.age}/>
      })}
    </div>
  );
};




export default App;
